import React, { useState, useEffect } from 'react';
import axios from 'axios';

const App = () => {

const [userData, setUserData] = useState(null);

const onClick=()=>{
    useEffect(() => {
        fetch("http://172.20.67.54:8080/reels/applicant?hashtag=#HYPE BOY", {
          method: "GET",
        })
          .then((response) => response.json())
          .then((data) => setUserData(data));
      }, []);
};


  return (
    <div>
      <div>
        <button onClick={onClick}>불러오기</button>
      </div>
      {userData && <textarea rows={7} value={JSON.stringify(userData, null, 2)} readOnly={true} />}
    </div>
  );
};


export default App;
